import React, {Component} from 'react';
import Feira from '../../components/Feira/Feira';

class Feiras extends Component {
    state = {
        feira: []
    }

    
    componentDidMount() {
        console.log(this.state);
        let feiras = [];
        feiras.push({nome: "nome 1"});
        feiras.push({nome: "nome 2"});
        console.log(feiras);
        this.setState({feiras: feiras});

    }

    render(){

        return(
            <div>
                <Feira local={this.state.feira[0]} nome={this.state.feira.nome}></Feira>
                <Feira></Feira>
            </div>
        );
    };
}

export default Feiras;
